function App(){
  return(
    <React.Fragment>
      <section class = "hero is-info is-primary">
        <HeaderControl/>
      </section>
      <div class = "webContainer">
        <div class = "columns">
          <div class = "column">
            <MainControl/>
          </div>
          <div class = "column">
            <TripInfoControl/>
          </div>
        </div>
      </div>
    </React.Fragment>
  )
}

export default App;
